  status: doc_expired
  uploaded_by: operator
  note: Le document chargé est le permis annuel d'opérations de la société CFC dans
    l'UFA 10 004. Dans sa forme et son fond il est conforme car similaire aux permis
    annuels validés dans l'OTP et signé par l'autorité compétente en l'occurrence
    le Ministre des forêts et de la faune. Conformément à la pratique une concession
    forestière constituée de plusieurs UFA peut disposer d'un seul plan d'aménagement.
    Et sur cette base, un seul permis annuel d'opération peut être délivré à l'entreprise
    exploitante. C'est la raison pour laquelle CFC a chargé en annexe l'arrêté d'approbation
    de son plan d'aménagement. Ainsi, le permis annuel d'opération de l'UFA 10 004
    peut être chargé pour toutes les autres UFA. Ce document peut donc être publié.
  source: company
